import React, { Component } from "react";
import { Grid, CardMedia, IconButton } from "@material-ui/core";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faChevronLeft,
  faChevronRight
} from "@fortawesome/free-solid-svg-icons";

var containerStyle = {
  backgroundImage:
    "url(https://images-na.ssl-images-amazon.com/images/I/7177FQIcHBL._UL1500_.jpg)",
  width: "100%",
  height: "100%"
};

class Home extends Component {
  render() {
    return (
      <div className={containerStyle}>
        <img src="" alt="shoe" width="100%" height="100%">
          <Grid
            container
            direction="row"
            style={{
              alignContent: "center",
              alignItems: "center",
              justifyContent: "space-between",
              flexGrow: 1
            }}
          >
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronLeft}
              />
            </IconButton>
            <IconButton>
              <FontAwesomeIcon
                style={{ color: "white" }}
                icon={faChevronRight}
              />
            </IconButton>
          </Grid>
        </img>
      </div>
    );
  }
}

// const Home = withStyles(styles)(({ classes }) => (

// ));

export default Home;
